import './time.css'

const Time = (props) =>{
    const bgColor = {backgroundColor : props.corSecundaria}
    const borderBottom = {borderColor : props.corPrimaria}

    return (
        <section className='time' style={bgColor}>
            <h3 style={borderBottom}>{props.nome}</h3>
            <></>
        </section>
    )
}
export default Time;
